import React from 'react';
import shopData from './shop_dummy_data.js';

class ShopPage extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      shopData,
    };
  }

  render() {
    console.log(this.state);
    return (
      <ul>
        {this.state.shopData.map(el => {
          console.log(el);
          return (
            <li key={el.id}>
              {el.name}
              <img src={el.imageUrl} />
            </li>
          );
        })}
      </ul>
    );
  }
}

export default ShopPage;
